    def makeHasanEasyProblems(self):
        self.problemH = {}
        for i in xrange(0,64):
            self.problemH[i]=0
        M=8
        #create first 10
        k=8
        for i in xrange(0,M):
            k=k+2
            self.problemH[M*i] = MultiRobotState(k,k,
                tuple( [ (k/2,k/2)])          
                ,frozenset(   [  (0, 0),(k-1,0),(k-1,k-1),(0,k-1)      ]   ),
                frozenset())
            
        #create first 20
        k=8
        for i in xrange(0,M):
            k=k+2
            self.problemH[M*i+1] = MultiRobotState(k,k,
                tuple( [ (k-1,k-1),(k-1,k-2),(k-2,k-1),(k-2,k-2)    ])          
                ,frozenset(   [  (0, 0),(k-1,0),(k/2,0),(0,k-1),(k/2,k/2)    ]   ),
                frozenset())
        
        #create first 30
        k=8
        for i in xrange(0,M):
            k=k+2
            dirts=set()
            for j in  xrange(1,k):
                dirts.add( (k/2-1,j) )
                dirts.add( (k/2,j) )
                dirts.add( (k/2,j) )
            self.problemH[M*i+2] = MultiRobotState(k,k,
                tuple( [ (0,0),(1,0),(k-1,0),(k-2,0),(k/2,k/2)    ])          
                ,frozenset(  dirts  ),
                frozenset())
        
        #create first 40
        k=8
        for i in xrange(0,M):
            k=k+2
            dirts=set()
            for j in  xrange(0,k):
                dirts.add( (j,j) )
            self.problemH[M*i+3] = MultiRobotState(k,k,
                tuple( [ (0,k-1),(k-1,0)   ])          
                ,frozenset(  dirts  ),
                frozenset())
        
        #create first 50
        k=8
        for i in xrange(0,M):
            k=k+2
            dirts=set()
            for j in  xrange(0,k):
                dirts.add( (j,j) )
            self.problemH[M*i+4] = MultiRobotState(k,k,
                tuple( [ (k/2,k/2),(k/2,k/2-3),(k/2,k/2-1),(k/2,k/2-2),(k/2,k/2+1),(k/2,k/2+2),(k/2,k/2+3)   ])          
                ,frozenset(  dirts  ),
                frozenset())
        
        #create first 60
